import React from 'react';
import { useRef } from 'react';

export default function Login() {

  return (
    <div>
        <h1>Sign in</h1>

        <form>
            <label htmlFor='username'>Username:</label>
            <input 
                type="text"
                autoComplete='off'
                id="username"

            />
        </form>
    </div>
  )
}
